import React from 'react'

const Pods = (props) => {
    const { pods } = props;
  return (
    <div>
      <center><h1>Pod List</h1></center>
      {pods.map((pod) => (
          <div>
            <h5>{pod.metadata}</h5>
            {/* <h6>{pod.Namespace}</h6> */}
        </div>
      ))}
    </div>
  )
};

export default Pods
